import './styles/content.css';
var React = require('react');

var createMatrix = () => {
  for(var i = 0; i < 3; i++) {
    return(
      <div></div>
    )
  }
}

var Content = () => {
  return(
    <div className='contentContainer'>
      <div className='gameBox'>
      {
        createMatrix()
      }
      </div>
    </div>
  )
}

export default Content;
